import React from "react";
import Footer from "./Footer";
import Header from "./Header";
import Note from "./Note";
import notes from "../notes";

function createNotes(noteItem){
    return <Note 
        content= {noteItem.content}
    />
}

function App(){
    return (
        <div>
            <Header />
            notes.map();
            <Footer />
        </div>
    );
}

export default App;
